<?php

namespace Database\Seeders;

use App\Models\About;
use Illuminate\Database\Seeder;
use App\Models\PersonalInfo;

class PersonalInfoSeeder extends Seeder
{
    public function run()
    {
        $base64Image = 'data:image/png;base64,';

        $personalInfo = PersonalInfo::create([
            'name' => 'Flávio Martil',
            'avatar' => null,
            'instagram' => 'https://instagram.com/flavowmatic/',
            'whatsapp' => 'https://api.whatsapp.com/send?phone=551731980760&text=Olá%2C%20vim%20pelo%20portfolio',
            'linkedin' => 'https://www.linkedin.com/in/flavio-martil',
            'email' => 'flaviomartil5@gmail.com',
            'user_id' => 1
        ]);
        $photo = $personalInfo->addMediaFromBase64($base64Image)->usingFileName('foto.webp')->toMediaCollection('photos');
        $absolutePath = $photo->getPath();
        $relativePath = str_replace(storage_path('app/public/'), '', $absolutePath);
        $personalInfo->avatar = asset('storage/' . $relativePath);
        $personalInfo->save();


    }
}
